	#Loads main form
	$OnLoadFormEvent={
		$username = $author
		loadMain -name $username
		$statusbar1.Text = "Doménovy radič: $domainControler | Prihlásený užívateľ: $username"
		
		Stop-Process -Id $launcherProcessID
	}
	
	<#
	.SYNOPSIS
	Loads default setting for GUI
	
	.DESCRIPTION
	Loads default settings for gui and checks user permissions
	
	.PARAMETER name
	username from ucn Active Directory based on windows credential
	#>
	function loadMain()
	{
		param (
			[Parameter(Mandatory = $True, Position = 1)]
			[string]$name
		)
		
		#check admin permisions
		if ((checkAdminPermission -name $name) -eq $true )
		{
			$nastaveniaToolStripMenuItem.Visible = $true
			$lokalityToolStripMenuItem.Visible = $true
			$uzivateliaToolStripMenuItem.Visible = $true
			$frontaToolStripMenuItem.Visible = $true
		}
		
		#check aplication functions permisions
		if ((checkPermission -function "budenie" -name $name) -eq $true)
		{
			$budenie.Enabled = $true
			$Gpupdate.Enabled = $true
		}
		else
		{
			$budenie.Enabled = $false
		}
		
		if ((checkPermission -function "vypinanie" -name $name) -eq $true)
		{
			$vypinanie.Enabled = $true
		}
		else
		{
			$vypinanie.Enabled = $false
		}
		
		if ((checkPermission -function "restart" -name $name) -eq $true)
		{
			$restart.Enabled = $true
		}
		else
		{
			$restart.Enabled = $false
		}
		
		if ((checkPermission -function "scheduler" -name $name) -eq $true)
		{
			$scheduler.Enabled = $true
		}
		else
		{
			$scheduler.Enabled = $false
		}
		
		if ((checkPermission -function "vypinanie" -name $name) -eq $true)
		{
			$vypinanie.Enabled = $true
		}
		else
		{
			$vypinanie.Enabled = $false
		}
		
		if ((checkPermission -function "rezim" -name $name) -eq $true)
		{
			$rezimy.Enabled = $true
		}
		else
		{
			$rezimy.Enabled = $false
		}
		
		if ((checkPermission -function "log" -name $name) -eq $true)
		{
			$log.Enabled = $true
		}
		else
		{
			$log.Enabled = $false
		}
		
		if ((checkPermission -function "pristupy" -name $name) -eq $true)
		{
			$pristupy.Enabled = $true
		}
		else
		{
			$pristupy.Enabled = $false
		}
		if ((checkPermission -function "irkala_cps" -name $name) -eq $true)
		{
			$IrkalaCPS.Enabled = $true
		}
		else
		{
			$IrkalaCPS.Enabled = $false
		}
		
		if ((checkPermission -function "safeq" -name $name) -eq $true)
		{
			$buttonSAFEQ.Enabled = $true
		}
		else
		{
			$buttonSAFEQ.Enabled = $false
		}
		
		if ((checkPermission -function "dhcp" -name $name) -eq $true)
		{
			$dhcp.Enabled = $true
		}
		else
		{
			$dhcp.Enabled = $false
		}
		
		if ((checkPermission -function "profil" -name $name) -eq $true)
		{
			$profil.Enabled = $true
		}
		else
		{
			$profil.Enabled = $false
		}
		if ((checkPermission -function "csirt" -name $name) -eq $true)
		{
			$csirt.Enabled = $true
		}
		else
		{
			$csirt.Enabled = $false
		}
		
		
	}
	
