	$global:search = ""
	#load form
	$formKonfiguraciaLokalit_Load={
		loadDataToLokalityGrid
	}
	
	#load localities to datagrid
	function loadDataToLokalityGrid()
	{
		$sqlSearch = $global:search
		$data = New-Object System.Data.DataSet
		$data = MysqlQuerySelect -query "SELECT id,name,dn,funkcia,broadcast FROM lokality WHERE name LIKE '%$sqlSearch%' OR dn LIKE '%$sqlSearch%' OR funkcia LIKE '%$sqlSearch%' OR broadcast LIKE '%$sqlSearch%' ORDER BY name ASC"
		$dataTable = new-object System.Data.DataTable
		$dataTable = $data.Tables[0]
		$datagridview1.DataSource = $dataTable
	}
	
	$pridatlokalitu_Click={
	
		if (Call-pridat_lokalitu_psf -eq 'OK')
		{
			loadDataToLokalityGrid
		}
	}
	
	$buttonZmazatVybranuLokalit_Click={
		if ([System.Windows.Forms.MessageBox]::Show("Naozaj chcete odstrániť vybrané lokality?", "Potvrdenie", [System.Windows.Forms.MessageBoxButtons]::OKCancel) -eq "OK")
		{
			$datagridview1.SelectedRows | foreach {
				$id = $_.Cells[0].value.ToString()
				$name = $_.Cells[1].value
				$dn = $_.Cells[2].value
				$funkcia = $_.Cells[3].value
				
				MysqlQueryInsert -query "DELETE FROM lokality WHERE id='$id' LIMIT 1"
			}
			loadDataToLokalityGrid
		}	
	}
	
	$buttonPridatFunkcionalitu_Click={
	
		$name = $dataGridView1.CurrentRow.Cells[1].value.ToString()
		$dn = $dataGridView1.CurrentRow.Cells[2].value.ToString()
		if ((Call-editLokalita_psf -LokalitaName $name ) -eq 'OK')
		{
			loadDataToLokalityGrid
		}
	}
	
	$buttonSearch_Click={
		#TODO: Place custom script here
		$global:search = $textbox1.Text
		loadDataToLokalityGrid
	}
		# --End User Generated Script--
