	#----------------------------------------------
	# User Generated Script
	#----------------------------------------------
	$global:search = ""
	#Load form
	$formKonfiguráciaUžívateľ_Load={
		loadDataToUzivateliaGrid
	}
	
	#load users data to datagrid
	function loadDataToUzivateliaGrid()
	{
		$data = New-Object System.Data.DataSet
		$sqlsearch = $global:search
		$data = MysqlQuerySelect -query "SELECT acl.id, acl.name, acl.id_lokalita AS lokalita, acl.funkcia FROM acl WHERE acl.name LIKE '%$sqlsearch%' OR acl.name LIKE '%$sqlsearch%' OR acl.id_lokalita LIKE '%$sqlsearch%' OR acl.funkcia LIKE '%$sqlsearch%'"
		$dataTable = new-object System.Data.DataTable
		$dataTable = $data.Tables[0]
		$datagridview1.DataSource = $dataTable
	}
	
	$buttonOdstranitVybranyZazn_Click={
		if ([System.Windows.Forms.MessageBox]::Show("Naozaj chcete odstrániť vybraných užívateľov?", "Potvrdenie", [System.Windows.Forms.MessageBoxButtons]::OKCancel) -eq "OK")
		{
			$datagridview1.SelectedRows | foreach {
				$id = $_.cells[0].Value
				MysqlQueryInsert -query "DELETE FROM acl WHERE id='$id' LIMIT 1"
			}
			loadDataToUzivateliaGrid
		}	
	}
	
	$buttonPridatUzivatela_Click={
	
		if (Call-pridat_uzivatela_psf -eq "OK")
		{
			loadDataToUzivateliaGrid
		}
	}
	
	$edit_Click={
	
		$lokalitaData = $dataGridView1.CurrentRow.Cells[2].value.ToString()
		$usernameData = $dataGridView1.CurrentRow.Cells[1].value.ToString()
		if ((Call-edituser_psf -lokalita $lokalitaData -username $usernameData) -eq 'OK')
		{
			loadDataToUzivateliaGrid
		}
	}
	
	$buttonSearch_Click={
		#TODO: Place custom script here
		$global:search = $textbox1.Text
		loadDataToUzivateliaGrid
	}
		# --End User Generated Script--
