		#Correct the initial state of the form to prevent the .Net maximized form issue
		$formKonfiguráciaUžívateľ.WindowState = $InitialFormWindowState
	}
	
	$Form_StoreValues_Closing=
	{
		#Store the control values
		$script:uzivatelia_textbox1 = $textbox1.Text
		$script:uzivatelia_datagridview1 = $datagridview1.SelectedCells
	}

	
	$Form_Cleanup_FormClosed=
	{
		#Remove all event handlers from the controls
		try
		{
			$buttonSearch.remove_Click($buttonSearch_Click)
			$edit.remove_Click($edit_Click)
			$buttonOdstranitVybranyZazn.remove_Click($buttonOdstranitVybranyZazn_Click)
			$buttonPridatUzivatela.remove_Click($buttonPridatUzivatela_Click)
			$formKonfiguráciaUžívateľ.remove_Load($formKonfiguráciaUžívateľ_Load)
			$formKonfiguráciaUžívateľ.remove_Load($Form_StateCorrection_Load)
			$formKonfiguráciaUžívateľ.remove_Closing($Form_StoreValues_Closing)
			$formKonfiguráciaUžívateľ.remove_FormClosed($Form_Cleanup_FormClosed)
		}
		catch [Exception]
		{ }
	}
