			{
				[System.Windows.Forms.MessageBox]::Show("Neboli vybrané žiadne PC")
			}
			else
			{
				#$lokalitaData = $combobox1.SelectedItem.ToString().Split('-')
				$zoznam = $combobox1.SelectedItem.id.ToString() + ";"
				$pc = $listbox1.SelectedItems
				$pc | foreach{
					$zoznam += $_.ToString() + ','
				}
				$zoznam = $zoznam -replace ".$"
				$date = Get-Date -Format u
