	#Loads form
	$formPridatOpakovanuUlohu_Load = {
		casLoad
		loadDataToLokalityCombobox
		$datetimepickerPlatnostOd.Value = Get-Date
		$datetimepickerPlatnostdo.Value = (Get-Date).AddDays(365)
		
	}
	
	#Loads localities to combobox
	function loadDataToLokalityCombobox()
	{
		$source = @()
		$groups = "acl.name='" + $author + "' "
		Get-ADPrincipalGroupMembership -Identity $author -server $domainControler | ForEach-Object{
			$groups += "OR acl.name='" + $_.name + "' "
		}
		
		$data = New-Object System.Data.DataSet
		$data = MysqlQuerySelect -query "SELECT * FROM lokality INNER JOIN acl ON lokality.name=acl.id_lokalita WHERE ($groups) AND acl.funkcia='budenie' AND lokality.funkcia='budenie' GROUP BY lokality.name ORDER BY lokality.name ASC"
		$dataTable = new-object System.Data.DataTable
		$dataTable = $data.Tables[0]
		
		
		$dataTable | foreach {
			$tmp = [pscustomobject]@{
				id = $_.id
				name = $_.name
			}
			$source += $tmp
		}
		
		Load-ComboBox -ComboBox $combobox1 -Items $source -Append -DisplayMember name
		
	}
	
	#Sets options for time
	function casLoad()
	{
		0..23 | foreach{
			$cislo = "{0:00}" -f $_
			$combobox2.Items.Add($cislo)
		}
		0..59 | foreach{
			$cislo = "{0:00}" -f $_
			$combobox3.Items.Add($cislo)
		}
	}
	
	
	$combobox1_SelectedIndexChanged = {
	
		#$hodnoty = $combobox1.SelectedItem.ToString().Split('-')
		$name = $combobox1.SelectedItem.name.ToString()
		
		$radiobuttonBudeniePC.Enabled = $false
		
		$radiobuttonVypínaniePC.Enabled = $false
		
		$radiobuttonReštartPC.Enabled = $false
		
		$radiobuttonRežimPC.Enabled = $false
	
		
		$data = New-Object System.Data.DataSet
		$data = MysqlQuerySelect -query "SELECT * FROM lokality WHERE name='$name' GROUP BY funkcia"
		$dataTable = new-object System.Data.DataTable
		$dataTable = $data.Tables[0]
		
		$dataTable | ForEach-Object{
			switch ($_.funkcia)
			{
				"budenie" {
					$radiobuttonBudeniePC.Enabled = $true
				}
				"vypinanie" {
					$radiobuttonVypínaniePC.Enabled = $true
				}
				"restart" {
					$radiobuttonReštartPC.Enabled = $true
				}
				"rezim" {
					$radiobuttonRežimPC.Enabled = $true
				}
				default
				{
					
				}
			}
		}
	}
	
	$buttonPridat_Click = {
	
		$nameLokalita = $combobox1.SelectedItem.name.ToString()
		$name = $textbox1.Text
		$emailConfirmText = $emailConfirm.Text
		
		$disabledFunction = "Nie"
		
		if ($radiobuttonAno.Checked)
		{
			$disabledFunction = "Ano"
		}
		
		if ($datetimepickerPlatnostOd.Value -ge $datetimepickerPlatnostdo.Value)
		{
			[System.Windows.Forms.MessageBox]::Show("Platnosť od-do nieje správny časový interval")
		}
		else
		{
			
			if ($radiobuttonRežimPC.Checked -eq $true -and $combobox4.SelectedItem -eq $null)
			{
				[System.Windows.Forms.MessageBox]::Show("Vyberte režim budenia")
			}
			else
			{
				if (($nameLokalita -notlike "") -and ($name -notlike "") -and ($combobox2.SelectedItem -ne $null) -and ($combobox3.SelectedItem -ne $null))
				{
					$checkFunkcia = $false
					#$lokalita = $nameLokalita.Split('-')
					$id_lokalita = $combobox1.SelectedItem.id.ToString()
					$time = "" + $combobox2.SelectedItem.ToString() + ":" + $combobox3.SelectedItem.ToString() + ""
					$validFrom = "" + $datetimepickerPlatnostOd.Value.Year.ToString() + "-" + $datetimepickerPlatnostOd.Value.Month.ToString() + "-" + $datetimepickerPlatnostOd.Value.Day + ""
					$validTo = "" + $datetimepickerPlatnostdo.Value.Year.ToString() + "-" + $datetimepickerPlatnostdo.Value.Month.ToString() + "-" + $datetimepickerPlatnostdo.Value.Day + ""
					
					$type = ""
					$note = $combobox4.SelectedItem.ToString()
					if ($radiobuttonBudeniePC.Checked)
					{
						$type = "budenie"
						$checkFunkcia = $true
					}
					if ($radiobuttonVypínaniePC.Checked)
					{
						$type = "vypinanie"
						$checkFunkcia = $true
					}
					if ($radiobuttonReštartPC.Checked)
					{
						$type = "restart"
						$checkFunkcia = $true
					}
					if ($radiobuttonRežimPC.Checked)
					{
						$type = "rezim"
						$checkFunkcia = $true
					}
					if ($checkFunkcia)
					{
						
						$vyber = $false
						$po = $ut = $str = $stv = $pia = $so = $ne = "Nie"
						if ($checkboxPondelok.Checked)
						{
							$po = "Áno"
							$vyber = $true
						}
						if ($checkboxUtorok.checked)
						{
							$ut = "Áno"
							$vyber = $true
						}
						if ($checkboxStreda.Checked)
						{
							$str = "Áno"
							$vyber = $true
						}
						if ($checkboxŠtvrtok.Checked)
						{
							$stv = "Áno"
							$vyber = $true
						}
						if ($checkboxPiatok.Checked)
						{
							$pia = "Áno"
							$vyber = $true
						}
						if ($checkboxSobota.Checked)
						{
							$so = "Áno"
							$vyber = $true
						}
						if ($checkboxNedeľa.Checked)
						{
							$ne = "Áno"
							$vyber = $true
						}
						if ($vyber)
						{
							$data = New-Object System.Data.DataSet
							$data = MysqlQuerySelect -query "INSERT INTO scheduler (id, id_lokalita, name, typ, time, funkcia, author, note, disabled, emailConfirm, validFrom, validTo) VALUES('', '$id_lokalita', '$name', 'repeat', '$time', '$type', '$author', '$note', '$disabledFunction', '$emailConfirmText', '$validFrom', '$validTo');SELECT LAST_INSERT_ID() AS id;"
							$dataTable = new-object System.Data.DataTable
							$dataTable = $data.Tables[0]
							
							$id_scheduler = $dataTable[0].id
							MysqlQueryInsert -query "INSERT INTO scheduler_time (id,time,pondelok,utorok,streda,stvrtok,piatok,sobota,nedela,id_scheduler) VALUES('', '$time', '$po', '$ut', '$str', '$stv', '$pia', '$so', '$ne', '$id_scheduler')"
							$formPridatOpakovanuUlohu.Close()
						}
						else
						{
							[System.Windows.Forms.MessageBox]::Show("Nebol vybraný žiadny deň v týdždni")
						}
					}
					else
					{
						[System.Windows.Forms.MessageBox]::Show("Vyberte aspoň jednú z dostupných funkcionalít")
					}
				}
				else
				{
					[System.Windows.Forms.MessageBox]::Show("Všetky povinné údaje musia byť vyplnené")
				}
			}
		}
	}
	
	
	$radiobuttonRežimPC_CheckedChanged={
	
		if ($radiobuttonRežimPC.Checked -eq $true)
