	#Loads localities to checkedlist
	function loadDataToLokalityCombobox()
	{
		$data = New-Object System.Data.DataSet
		$data = MysqlQuerySelect -query "SELECT id, name FROM lokality WHERE funkcia = 'budenie' OR funkcia = 'vypinanie' OR funkcia = 'rezim' OR funkcia = 'gpudpate' OR funkcia = 'restart' GROUP BY name ORDER BY name ASC"
		$dataTable = new-object System.Data.DataTable
		$dataTable = $data.Tables[0]
		
		$source = @()
		$dataTable | foreach {
			$tmp = [pscustomobject]@{
				id = $_.id
				name = $_.name
			}
			$source += $tmp
		}
		$checkedlistbox2.Items.AddRange($source)
		$checkedlistbox2.DisplayMember = "name"
		#Load-ComboBox -ComboBox $combobox1 -Items $source -Append -DisplayMember name
	}
	
