	#Returns part of SQL query with computer names of locality by locality id via LDAP
	function computerListBy()
	{
		param (
			[Parameter(Mandatory = $True, Position = 1)]
			[string]$id
		)
		$data = New-Object System.Data.DataSet
		$data = MysqlQuerySelect -query "SELECT * FROM lokality WHERE id='$id'"
		$dataTable = new-object System.Data.DataTable
		$dataTable = $data.Tables[0]
		$ou = $dataTable[0].dn
		
		
		$domenaRaw = $ou -split "DC="
		$domenaRaw[1] = $domenaRaw[1] -replace ".$"
		$domenaRaw[2] = $domenaRaw[2] -replace ".$"
		$domenaRaw[3] = $domenaRaw[3] -replace ".$"
		$domena = $domenaRaw[1] + "." + $domenaRaw[2] + "." + $domenaRaw[3] + "." + $domenaRaw[4]
		
		$ldapSettings = "LDAP://$ou"
		$root = [ADSI]$ldapSettings
		$search = [adsisearcher]$root
		$Search.Filter = "(&(objectCategory=computer))"
		$colResults = $Search.FindAll()
		$sqlitem="computer_name=''"
		foreach ($i in $colResults)
		{
			$sqlitem += " OR computer_name='" + $i.Properties.Item('cn') + "." + $domena + "'"
			
		}
		return $sqlitem
	}
	
	#Loads log data to datagrid
	function loadDataToLogBudenieGrid()
	{
		Param (
			[boolean]$firstLoad
		)
		
		
		
		$nameAuthor = [Environment]::UserName
		$sqlLimit = $numberOfItems.Text
		
		
		if ($firstLoad -eq $true)
		{
			$sqlLokalita = ""
		}
		else
		{
			if ($checkedlistbox2.CheckedItems -ne $null)
			{
				#$dataLokalita = $combobox1.SelectedItem.ToString().Split('-')
				$tmpLocality = ""
				$computersList = ""
				$checkedlistbox2.CheckedItems | foreach {
					$tmpLocality = $_.id
					$computersList += ' '
					$computersList += computerListBy -id $tmpLocality
					$computersList += ' OR '
				}
				$tmpcomp = $computersList.Substring(0, ($computersList.Length) - 4)
				$sqlLokalita = "AND (" + $tmpcomp + ")"
			}
			else
			{
				$sqlLokalita = ""
			}
		}
		
		if ($filterStatus -eq "ALL")
		{
			$filterStatus = ""
		}
		
		if ((checkAdminPermission -name $nameAuthor) -eq $false)
		{
			$sql = " WHERE author='$nameAuthor' $sqlLokalita AND first_check>='$filterOd' AND first_check<='$filterDo' AND computer_name LIKE '%" + $filterName + "%' AND status LIKE '%" + $filterStatus + "%'"
			if ($firstLoad -eq $true) { $sql = " WHERE author='$nameAuthor' " }
		}
		else
		{
			$sql = " WHERE first_check>='$filterOd' $sqlLokalita AND first_check<='$filterDo' AND computer_name LIKE '%" + $filterName + "%' AND status LIKE '%" + $filterStatus + "%'"
			if ($firstLoad -eq $true) { $sql = " WHERE status LIKE '%%' " }
		}
		$sqladd = ""
		$checkType = $false
		
		
		$checkedlistbox1.CheckedItems | foreach {
			$sqladd += " OR process='$($_)' "
			$checkType = $true
		}
		
		$sql+=" AND ( process='' "+$sqladd+")"
		$data = New-Object System.Data.DataSet
		
		
		$data = MysqlQuerySelect -query "SELECT id, computer_name, status, first_check, last_check, note1, note2, author, process FROM logs $sql ORDER BY id DESC LIMIT 0,$sqlLimit"
		$dataTable = new-object System.Data.DataTable
		$dataTable = $data.Tables[0]
		$datagridview1.DataSource = $dataTable
		
		$dataCount = MysqlQuerySelect -query "SELECT count(id) AS finalCount FROM logs $sql"
		$dataTableCount = new-object System.Data.DataTable
		$dataTableCount = $dataCount.Tables[0]
		$finalCount.Text = $dataTableCount[0].finalCount
		
		$global:sqlQuery = "SELECT id, computer_name, status, first_check, last_check, note1, note2, author, process FROM logs $sql ORDER BY id DESC LIMIT 0,$sqlLimit"
		
		dataGridPaint
		
		$loading.Visible = $false
	}
	
