		loadFunctions
	}
	
	#loads available functions of locality
	function loadFunctions()
	{
	
		$data = New-Object System.Data.DataSet
		$data = MysqlQuerySelect -query "SELECT * FROM lokality WHERE name='$LokalitaName'"
		$dataTable = new-object System.Data.DataTable
		$dataTable = $data.Tables[0]
		$textbox1.Text = $LokalitaName
		$textbox2.Text = $dataTable.rows[0].dn
		$textbox3.Text = $dataTable.rows[0].broadcast
		$global:oldDN = $dataTable.rows[0].dn
		$global:oldBroadcast = $dataTable.rows[0].broadcast
	
		$dataTable | foreach{
			switch ($_.funkcia) {
				"budenie" {
					$checkboxBudeniePC.Checked = $true
					$checkboxBudeniePC.Enabled = $false
				}
				"vypinanie" {
					$checkboxVypínaniePC.Checked = $true
					$checkboxVypínaniePC.Enabled = $false
				}
				"restart" {
					$checkboxReštartPC.Checked = $true
					$checkboxReštartPC.Enabled = $false
				}
				"rezim" {
					$checkboxRežimPC.Checked = $true
					$checkboxRežimPC.Enabled = $false
				}
				"scheduler" {
					$checkboxScheduler.Checked = $true
					$checkboxScheduler.Enabled = $false
				}
				"pristupy" {
					$checkboxAccess.Checked = $true
					$checkboxAccess.Enabled = $false
				}
				"irkala_cps" {
					$checkboxIrkala_CPS.Checked = $true
					$checkboxIrkala_CPS.Enabled = $false
				}
				"dhcp" {
					$checkboxDHCP.Checked = $true
					$checkboxDHCP.Enabled = $false
				}
				"safeq" {
					$checkboxSAFEQ.Checked = $true
					$checkboxSAFEQ.Enabled = $false
				}
				"profil" {
					$checkboxProfily.Checked = $true
					$checkboxProfily.Enabled = $false
				}
				default {
					
				}
			}
		}
	}
	
	$buttonUpravit_Click={
	
		$checkFunkcia = $false
		$dn = $textbox2.Text
		$broadcast = $textbox3.Text
		
		
		if ($checkboxBudeniePC.Checked -and $checkboxBudeniePC.Enabled)
		{
			MysqlQueryInsert -query "INSERT INTO lokality (id, name, dn, funkcia, broadcast) VALUES('','$LokalitaName', '$dn', 'budenie', '$broadcast')"
			$checkFunkcia = $true
		}
		if ($checkboxVypínaniePC.Checked -and $checkboxVypínaniePC.Enabled)
		{
			MysqlQueryInsert -query "INSERT INTO lokality (id, name, dn, funkcia, broadcast) VALUES('','$LokalitaName', '$dn', 'vypinanie', '$broadcast')"
			$checkFunkcia = $true
		}
		if ($checkboxReštartPC.Checked -and $checkboxReštartPC.Enabled)
		{
			MysqlQueryInsert -query "INSERT INTO lokality (id, name, dn, funkcia, broadcast) VALUES('','$LokalitaName', '$dn', 'restart', '$broadcast')"
			$checkFunkcia = $true
		}
		if ($checkboxRežimPC.Checked -and $checkboxRežimPC.Enabled)
		{
			MysqlQueryInsert -query "INSERT INTO lokality (id, name, dn, funkcia, broadcast) VALUES('','$LokalitaName', '$dn', 'rezim', '$broadcast')"
			$checkFunkcia = $true
		}
		if ($checkboxScheduler.Checked -and $checkboxScheduler.Enabled)
		{
			MysqlQueryInsert -query "INSERT INTO lokality (id, name, dn, funkcia, broadcast) VALUES('','$LokalitaName', '$dn', 'scheduler', '$broadcast')"
			$checkFunkcia = $true
		}
		if ($checkboxAccess.Checked -and $checkboxAccess.Enabled)
		{
			MysqlQueryInsert -query "INSERT INTO lokality (id, name, dn, funkcia, broadcast) VALUES('','$LokalitaName', '$dn', 'pristupy', '$broadcast')"
			$checkFunkcia = $true
		}
		if ($checkboxIrkala_CPS.Checked -and $checkboxIrkala_CPS.Enabled)
		{
			MysqlQueryInsert -query "INSERT INTO lokality (id, name, dn, funkcia, broadcast) VALUES('','$LokalitaName', '$dn', 'irkala_cps', '$broadcast')"
			$checkFunkcia = $true
		}
		if ($checkboxDHCP.Checked -and $checkboxDHCP.Enabled)
		{
			MysqlQueryInsert -query "INSERT INTO lokality (id, name, dn, funkcia, broadcast) VALUES('','$LokalitaName', '$dn', 'dhcp', '$broadcast')"
			$checkFunkcia = $true
		}
		if ($checkboxSAFEQ.Checked -and $checkboxSAFEQ.Enabled)
		{
			MysqlQueryInsert -query "INSERT INTO lokality (id, name, dn, funkcia, broadcast) VALUES('','$LokalitaName', '$dn', 'safeq', '$broadcast')"
			$checkFunkcia = $true
		}
		if ($checkboxProfily.Checked -and $checkboxProfily.Enabled)
		{
			MysqlQueryInsert -query "INSERT INTO lokality (id, name, dn, funkcia, broadcast) VALUES('','$LokalitaName', '$dn', 'profil', '$broadcast')"
			$checkFunkcia = $true
		}
		
		if ($oldDN -ne $dn)
		{
			MysqlQueryInsert -query "UPDATE lokality SET dn='$dn' WHERE name='$LokalitaName' AND dn='$oldDN' "
			$checkFunkcia = $true
		}
		
		if ($oldBroadcast -ne $broadcast)
		{
			MysqlQueryInsert -query "UPDATE lokality SET broadcast='$broadcast' WHERE name='$LokalitaName' AND broadcast='$oldBroadcast' AND dn='$dn' "
			$checkFunkcia = $true
		}
		
		
		if ($checkFunkcia)
		{
			$editLokalita.Close()
		}
		else
		{
			[System.Windows.Forms.MessageBox]::Show("Vyberte aspoň jednú z dostupných funkcionalít")
		}
	}
	
