	function checkActionEnd()
	{
		Param (
			[int]$actionID	
		)
		$dataTable = "not empty"
		$formProfil.Cursor = 'WaitCursor'
		$formProfil.Enabled = $false
		$i = 0
		$progressbar1.Visible = $true
		$progressbar1.MarqueeAnimationSpeed = 100
		$script:LawCancelLoop = $false
		$operationStatus.ForeColor = 'Purple'
		$operationStatus.Text = "Prebieha kontrola profilu "
		while (($dataTable -ne $null) -and ($i -lt $checkProfileTimeout))
		{
			
			[System.Windows.Forms.Application]::DoEvents()
			if (($i % 100) -eq 0)
			{
				$action = New-Object System.Data.DataSet
				$action = mysqlQuerySelect -query "SELECT * FROM fronta WHERE command='oss' AND status<>'DONE' AND id='$actionID' "
				$dataTable = new-object System.Data.DataTable
				$dataTable = $action.Tables[0]
				
			}
			sleep -Milliseconds 10
			
			$i++
		}
		
		if ($i -eq $checkProfileTimeout)
		{
			$operationStatus.ForeColor = 'Red'
			$operationStatus.Text = "Profil sa nepodarilo spracovať vo vyhradenom čase..."
		}
		else
		{
			$action = New-Object System.Data.DataSet
			$action = mysqlQuerySelect -query "SELECT * FROM fronta WHERE command='oss' AND status='DONE' AND id='$actionID' "
			$dataTable = new-object System.Data.DataTable
			$dataTable = $action.Tables[0]
			if ((($dataTable.rows[0][2]).split(';', 3))[2] -match "chybove hlasenie")
			{
				$operationStatus.ForeColor = 'Red'
				$operationStatus.Text = "Spracovanie skončilo chybou"
				#[System.Windows.Forms.MessageBox]::Show((($dataTable.rows[0][2]).split(';', 3))[2], "ERROR")
			}
			else
			{
				$operationStatus.ForeColor = 'Green'
				$operationStatus.Text = "Roaming profil bol zabalený a uložený v root adresári profilu vo forme .zip súboru"
				#[System.Windows.Forms.MessageBox]::Show((($dataTable.rows[0][2]).split(';', 3))[2], "OK")
			}
		}
		
		$script:LawCancelLoop = $true
		$formProfil.Cursor = 'Arrow'
		$formProfil.Enabled = $true
		$progressbar1.Visible = $false
		$progressbar1.MarqueeAnimationSpeed = 0
	}
	function validateUCO()
	{
		$uco = $textUco.Text.ToString()
		if ($uco -match "(\d[0-6])")
		{
			$textUco.ForeColor = 'Green'
			$errorprovider1.SetError($textUco, "")
			$buttonUcoCheck.Enabled = $true
			
		}
		else
		{
			$textUco.ForeColor = 'Red'
			$errorprovider1.SetError($textUco, "Zadajte UČO v správnom tvare, 6 číslic z rozsahu 0-9")
			$buttonUcoCheck.Enabled = $false
		}
		
	}
	
	$buttonUcoCheck_Click={
		#TODO: Place custom script here
		if ([System.Windows.Forms.MessageBox]::Show("Naozaj chcete skontrolovať tento profil?", "Potvrdenie", [System.Windows.Forms.MessageBoxButtons]::OKCancel) -eq "OK")
		{
			$uco = $textUco.Text.ToString()
			if (($uco -notmatch "(\d[0-6])") -or (($checkboxCheckPermissions.Checked -eq $false) -and ($checkboxZipAndDelete.Checked -eq $false)))
			{
				[System.Windows.Forms.MessageBox]::Show("Skontrolujte správnosť UČO a vyberte aspoň jednu z dostupných možnosti")						
			}
			else
			{
				$uco +=";"
				if ($checkboxCheckPermissions.Checked -eq $true)
				{
					$uco+="checkPermissions,"
				}
				if ($checkboxZipAndDelete.Checked -eq $true)
				{
					$uco += "zipAndDelete,"
				}
				
				$date = Get-Date -Format u
				$actionInsertAndSelect = New-Object System.Data.DataSet
				$actionInsertAndSelect = MysqlQuerySelect -query "INSERT INTO fronta (id, command, parameter, status, date, author) VALUES('', 'oss', '$uco', 'WAITING', '$date', '$author');SELECT LAST_INSERT_ID();"
				$dataTable = new-object System.Data.DataTable
				$dataTable = $actionInsertAndSelect.Tables[0]
				checkActionEnd -actionID $dataTable.rows[0][0]
			}
		}
	}
	
	$textUco_TextChanged={
		#TODO: Place custom script here
		validateUCO
	}
	
	$textUco_Validating=[System.ComponentModel.CancelEventHandler]{
	#Event Argument: $_ = [System.ComponentModel.CancelEventArgs]
		#TODO: Place custom script here
		validateUCO
