	$adGroupMember = "Domain users"
	
	$formLAWPrístupy_Load={
		#TODO: Initialize Form Controls here
		#LoadGroupMembership -adGroup $global:adGroup -adGroupMember $adGroupMember
		loadDataToLokalityCombobox
		$progressbar1.MarqueeAnimationSpeed = 0
