		else
		{
			
			if ($radiobuttonRežimPC.Checked -eq $true -and $combobox4.SelectedItem -eq $null)
			{
				[System.Windows.Forms.MessageBox]::Show("Vyberte režim budenia")
			}
			else
			{
				if (($updateLokalitaID -ne -1) -and ($updateName -notlike "") -and ($combobox2.SelectedItem -ne $null) -and ($combobox3.SelectedItem -ne $null))
				{
					#### TYP
					
					$type = ""
					$checkFunckia = $false
					if ($radiobuttonBudeniePC.Checked)
					{
						$type = "budenie"
						$checkFunkcia = $true
						$updateNote = ""
					}
					if ($radiobuttonVypínaniePC.Checked)
					{
						$type = "vypinanie"
						$checkFunkcia = $true
						$updateNote = ""
					}
					if ($radiobuttonReštartPC.Checked)
					{
						$type = "restart"
						$checkFunkcia = $true
						$updateNote = ""
					}
					if ($radiobuttonRežimPC.Checked)
					{
						$type = "rezim"
						$checkFunkcia = $true
					}
					
					###### DNI
					if ($checkFunkcia)
					{
						$vyber = $false
						$po = $ut = $str = $stv = $pia = $so = $ne = "Nie"
						if ($checkboxPondelok.Checked)
						{
							$po = "Áno"
							$vyber = $true
						}
						if ($checkboxUtorok.checked)
						{
							$ut = "Áno"
							$vyber = $true
						}
						if ($checkboxStreda.Checked)
						{
							$str = "Áno"
							$vyber = $true
						}
						if ($checkboxŠtvrtok.Checked)
						{
							$stv = "Áno"
							$vyber = $true
						}
						if ($checkboxPiatok.Checked)
						{
							$pia = "Áno"
							$vyber = $true
						}
						if ($checkboxSobota.Checked)
						{
							$so = "Áno"
							$vyber = $true
						}
						if ($checkboxNedeľa.Checked)
						{
							$ne = "Áno"
							$vyber = $true
						}
						
						$data = New-Object System.Data.DataSet
						$data = MysqlQuerySelect -query "UPDATE scheduler SET name='$updateName', emailConfirm='$updateEmailConfirm', time='$updateDatetime', disabled='$updateDisabled', funkcia='$type', id_lokalita='$updateLokalitaID', note='$updateNote', validFrom='$validFrom', validTo='$validTo'  WHERE scheduler.id='$lokalitaId' "
						$dataTable = new-object System.Data.DataTable
						$dataTable = $data.Tables[0]
						
						$data = New-Object System.Data.DataSet
						$data = MysqlQuerySelect -query "UPDATE scheduler_time SET time='$updateDaytime', pondelok='$po', utorok='$ut', streda='$str', stvrtok='$stv', piatok='$pia', sobota='$so', nedela='$ne'  WHERE id_scheduler='$lokalitaId' "
						$dataTable = new-object System.Data.DataTable
						$dataTable = $data.Tables[0]
						
						#[System.Windows.Forms.MessageBox]::Show("Úloha bola upravená", "Info", [System.Windows.Forms.MessageBoxButtons]::OK)
						$script:ReturnStatus = $true
						$formEditRepeatTask.close()
					}
					else
					{
						[System.Windows.Forms.MessageBox]::Show("Vyberte aspoň jednú z dostupných funkcionalít")
					}
				}
				else
				{
					[System.Windows.Forms.MessageBox]::Show("Všetky povinné údaje musia byť vyplnené")
				}
			}
		}
