	function casLoad()
	{
		0..23 | foreach{
			$cislo = "{0:00}" -f $_
			$combobox2.Items.Add($cislo)
		}
		0..59 | foreach{
			$cislo = "{0:00}" -f $_
			$combobox3.Items.Add($cislo)
		}
	}
	
	#Loads localities to combobox
	function loadDataToLokalityCombobox()
	{
		$source = @()
		$groups = "acl.name='" + $author + "' "
		Get-ADPrincipalGroupMembership -Identity $author -server $domainControler | ForEach-Object{
			$groups += "OR acl.name='" + $_.name + "' "
		}
		
		$data = New-Object System.Data.DataSet
		$data = MysqlQuerySelect -query "SELECT * FROM lokality INNER JOIN acl ON lokality.name=acl.id_lokalita WHERE ($groups) AND acl.funkcia='budenie' AND lokality.funkcia='budenie' GROUP BY lokality.name ORDER BY lokality.name ASC"
		$dataTable = new-object System.Data.DataTable
		$dataTable = $data.Tables[0]
		
		
		$dataTable | foreach {
			$tmp = [pscustomobject]@{
				id = $_.id
				name = $_.name
			}
			$source += $tmp
		}
		
		Load-ComboBox -ComboBox $combobox1 -Items $source -Append -DisplayMember name
		
	}
	
	
	
	function loadLocalityFunctions()
	{
		Param (
			[string]$name
		)
		#$hodnoty = $combobox1.SelectedItem.ToString().Split('-')
		
		$radiobuttonBudeniePC.Enabled = $false
		
		$radiobuttonVypínaniePC.Enabled = $false
		
		$radiobuttonReštartPC.Enabled = $false
		
		$radiobuttonRežimPC.Enabled = $false
		
		
		$data = New-Object System.Data.DataSet
		$data = MysqlQuerySelect -query "SELECT * FROM lokality WHERE name='$name' GROUP BY funkcia"
		$dataTable = new-object System.Data.DataTable
		$dataTable = $data.Tables[0]
		
		$dataTable | ForEach-Object{
			switch ($_.funkcia)
			{
				"budenie" {
					$radiobuttonBudeniePC.Enabled = $true
				}
				"vypinanie" {
					$radiobuttonVypínaniePC.Enabled = $true
				}
				"restart" {
					$radiobuttonReštartPC.Enabled = $true
				}
				"rezim" {
					$radiobuttonRežimPC.Enabled = $true
				}
				default
				{
					
				}
			}
		}
	}
	
	
	function loadDataFromDatabase()
	{
		$data = New-Object System.Data.DataSet
		$data = MysqlQuerySelect -query "SELECT disabled, note, time, scheduler.funkcia AS taskType, scheduler.name AS schedulerTaskName, emailConfirm, id_lokalita, lokality.name AS lokalityName  FROM scheduler INNER JOIN lokality ON (scheduler.id_lokalita=lokality.id) WHERE scheduler.typ='once' AND scheduler.id='$lokalitaId' "
		$dataTable = new-object System.Data.DataTable
		$dataTable = $data.Tables[0]
		
		$textbox1.Text = $dataTable.rows[0].schedulerTaskName
		$dayTimeRaw = $dataTable.rows[0].time -Split " "
		$dayTime = $dayTimeRaw[1] -Split ":"
		
		$datetimepicker1.Value = $dataTable.rows[0].time
		
		$combobox2.SelectedIndex = $combobox2.FindStringExact("{0:00}" -f $dayTime[0])
		$combobox3.SelectedIndex = $combobox3.FindStringExact("{0:00}" -f $dayTime[1])
		
		$emailConfirm.Text = $dataTable.rows[0].emailConfirm
		$combobox1.SelectedIndex = $combobox1.FindString($dataTable.rows[0].lokalityName)
		
		loadLocalityFunctions -name $dataTable.rows[0].lokalityName
		
		
		switch ($dataTable.rows[0].taskType)
		{
			"budenie" {
				$radiobuttonBudeniePC.Checked = $true
			}
			"vypinanie" {
				$radiobuttonVypínaniePC.Checked = $true
			}
			"restart" {
				$radiobuttonReštartPC.Checked = $true
			}
			"rezim" {
				$radiobuttonRežimPC.Checked = $true
				$labelTypRežimu.Enabled = $true
				$labelTypRežimu.Visible = $true
				$combobox4.Enabled = $true
				$combobox4.Visible = $true
				$combobox4.Selectedindex = $combobox4.FindStringExact($dataTable.rows[0].note)
			}
		}
		
			
		if ($dataTable.rows[0].disabled -eq "Ano")
		{
			$radiobuttonAno.Checked = $true
		}
		else
		{
			$radiobuttonNie.Checked = $true
		}
		
	}
	
	$radiobuttonRežimPC_CheckedChanged={
		#TODO: Place custom script here
		if ($radiobuttonRežimPC.Checked -eq $true)
		{
			$labelTypRežimu.Enabled = $true
			$labelTypRežimu.Visible = $true
			$combobox4.Enabled = $true
			$combobox4.Visible = $true
		}
		else
		{
			$labelTypRežimu.Enabled = $false
			$labelTypRežimu.Visible = $false
			$combobox4.Enabled = $false
			$combobox4.Visible = $false
		}
	}
	
	$buttonPridat_Click={
		#TODO: Place custom script here
		$updateName = $textbox1.Text
		
		$updateDatetime = "" + $datetimepicker1.Value.Year.ToString() + "-" + $datetimepicker1.Value.Month.ToString() + "-" + $datetimepicker1.Value.Day + " " + $combobox2.SelectedItem.ToString() + ":" + $combobox3.SelectedItem.ToString()
		
		$updateEmailConfirm = $emailConfirm.Text
		
		### NOTE
		$updateNote = $combobox4.SelectedItem.ToString()
		
		### LOCALITY
		$updateLokalitaID = $combobox1.SelectedItem.id.ToString()
		
		##### DISABLED
		
		$updateDisabled = "Nie"
		if ($radiobuttonAno.Checked -eq $true)
		{
			$updateDisabled = "Ano"
		}
		else
		{
			$updateDisabled = "Nie"
		}
		
		if ($radiobuttonRežimPC.Checked -eq $true -and $combobox4.SelectedItem -eq $null)
		{
			[System.Windows.Forms.MessageBox]::Show("Vyberte režim budenia")
		}
		else
		{
			if (($updateLokalitaID -ne -1) -and ($updateName -notlike "") -and ($combobox2.SelectedItem -ne $null) -and ($combobox3.SelectedItem -ne $null))
			{
				#### TYP
				
				$type = ""
				$checkFunckia = $false
				if ($radiobuttonBudeniePC.Checked)
				{
					$type = "budenie"
					$checkFunkcia = $true
					$updateNote = ""
				}
				if ($radiobuttonVypínaniePC.Checked)
				{
					$type = "vypinanie"
					$checkFunkcia = $true
					$updateNote = ""
				}
				if ($radiobuttonReštartPC.Checked)
				{
					$type = "restart"
					$checkFunkcia = $true
					$updateNote = ""
				}
				if ($radiobuttonRežimPC.Checked)
				{
					$type = "rezim"
					$checkFunkcia = $true
				}
				
				###### DNI
				if ($checkFunkcia)
				{
									
					$data = New-Object System.Data.DataSet
					$data = MysqlQuerySelect -query "UPDATE scheduler SET name='$updateName', emailConfirm='$updateEmailConfirm', time='$updateDatetime', disabled='$updateDisabled', funkcia='$type', id_lokalita='$updateLokalitaID', note='$updateNote'  WHERE scheduler.id='$lokalitaId' "
					$dataTable = new-object System.Data.DataTable
					$dataTable = $data.Tables[0]
					
					$script:ReturnStatus = $true
					$formEditOnceTask.close()
				}
				else
				{
					[System.Windows.Forms.MessageBox]::Show("Vyberte aspoň jednú z dostupných funkcionalít")
				}
			}
			else
			{
				[System.Windows.Forms.MessageBox]::Show("Všetky povinné údaje musia byť vyplnené")
			}
		}
	}
	
