	function checkActionEnd()
	{
		Param (
			[int]$actionID
		)
		$dataTable = "not empty"
	
		$formIrkala_CPS.Cursor = 'WaitCursor'
		$formIrkala_CPS.Enabled = $false
		$i = 0
		$progressbar1.Visible = $true
		$progressbar1.MarqueeAnimationSpeed = 100
		$script:LawCancelLoop = $false
		$operationStatus.ForeColor = 'Purple'
		$operationStatus.Text = "Prebieha reštart služby"
		while (($dataTable -ne $null) -and ($i -lt $checkIrkalaTimeout))
		{
			
			[System.Windows.Forms.Application]::DoEvents()
			if (($i % 100) -eq 0)
			{
				$action = New-Object System.Data.DataSet
				$action = mysqlQuerySelect -query "SELECT * FROM fronta WHERE command='irkala_cps' AND status<>'DONE' AND id='$actionID' "
				$dataTable = new-object System.Data.DataTable
				$dataTable = $action.Tables[0]
			}
			sleep -Milliseconds 10
			
			$i++
		}
		
		if ($i -eq $checkIrkalaTimeout)
		{
			$operationStatus.ForeColor = 'Red'
			$operationStatus.Text = "Službu sa nepodarilo reštartovať vo vyhradenom čase..."
		}
		else
		{
			$action = New-Object System.Data.DataSet
			$action = mysqlQuerySelect -query "SELECT * FROM fronta WHERE command='irkala_cps' AND status='DONE' AND id='$actionID' "
			$dataTable = new-object System.Data.DataTable
			$dataTable = $action.Tables[0]
			if ($dataTable.rows[0][2] -match "chybove hlasenie")
			{
				$operationStatus.ForeColor = 'Red'
				$operationStatus.Text = "Spracovanie skončilo chybou, nepodarilo sa reštartovať službu"
				#[System.Windows.Forms.MessageBox]::Show((($dataTable.rows[0][2]).split(';', 3))[2], "ERROR")
			}
