	function checkActionEnd()
	{
		Param (
			[int]$actionID
		)
		$dataTable = "not empty"
		
		$formDHCP.Cursor = 'WaitCursor'
		$formDHCP.Enabled = $false
		$i = 0
		$progressbar1.Visible = $true
		$progressbar1.MarqueeAnimationSpeed = 100
		$script:LawCancelLoop = $false
		$operationStatus.ForeColor = 'Purple'
		$operationStatus.Text = "Prebieha spracovanie požiadavku"
		while (($dataTable -ne $null) -and ($i -lt $checkIrkalaTimeout))
		{
			
			[System.Windows.Forms.Application]::DoEvents()
			if (($i % 100) -eq 0)
			{
				$action = New-Object System.Data.DataSet
				$action = mysqlQuerySelect -query "SELECT * FROM fronta WHERE command='dhcp' AND status<>'DONE' AND id='$actionID' "
				$dataTable = new-object System.Data.DataTable
				$dataTable = $action.Tables[0]
			}
			sleep -Milliseconds 10
			
			$i++
		}
		
		if ($i -eq $checkIrkalaTimeout)
		{
			$operationStatus.ForeColor = 'Red'
			$operationStatus.Text = "Požiadavok sa nepodarilo spracovať vo vyhradenom čase..."
		}
		else
		{
			$action = New-Object System.Data.DataSet
			$action = mysqlQuerySelect -query "SELECT * FROM fronta WHERE command='dhcp' AND status='DONE' AND id='$actionID' "
			$dataTable = new-object System.Data.DataTable
			$dataTable = $action.Tables[0]
			$result = ($dataTable.rows[0][2]).split(';')[4]
			$scopeContent = ($dataTable.rows[0][2]).split(';')[5]
			
			$scopeContentStructure = New-Object System.Collections.ArrayList
			
			$scopeContent.split(",") | foreach {
				$data = $_.split("|")
				$Object = New-Object PSObject
				$Object | add-member Noteproperty IPaddress $data[0]
				$Object | add-member Noteproperty MACaddress $data[1]
				$Object | add-member Noteproperty Name $data[2]
				$scopeContentStructure += ($Object)
			}
			
			
			
		}
		
		
		
		if ($dataTable.rows[0][2] -match "chybove hlasenie")
		{
			$operationStatus.ForeColor = 'Red'
			$operationStatus.Text = "Spracovanie skončilo chybou." + $($result -replace "chybove hlasenie:", "")			
			#[System.Windows.Forms.MessageBox]::Show((($dataTable.rows[0][2]).split(';', 3))[2], "ERROR")
		}
		else
		{
			$operationStatus.ForeColor = 'Green'
			$operationStatus.Text = "Spracovanie vášho požiadavku bolo úspešne.$($result)"
			$scopeContentStructure | Out-GridView -Title "Zoznam DHCP rezervácii"
			#[System.Windows.Forms.MessageBox]::Show((($dataTable.rows[0][2]).split(';', 3))[2], "OK")
		}
		
		
		$script:LawCancelLoop = $true
		$formDHCP.Cursor = 'Arrow'
		$formDHCP.Enabled = $true
		$progressbar1.Visible = $false
		$progressbar1.MarqueeAnimationSpeed = 0
	}
	
	
	
