					}
					if ($radiobuttonMACbyIP.Checked -eq $true)
					{
						$command = "MACbyIP"
					}
					if ($radiobuttonNewReservation.Checked -eq $true)
					{
						$command = "NewIP"
					}
					
					$command += ";" + $combobox1.SelectedItem.Name + ";" + $textboxIP.Text + ";" + $textboxMAC.Text
					
					$date = Get-Date -Format u
					$actionInsertAndSelect = New-Object System.Data.DataSet
					$actionInsertAndSelect = MysqlQuerySelect -query "INSERT INTO fronta (id, command, parameter, status, date, author) VALUES('', 'dhcp', '$command', 'WAITING', '$date', '$author');SELECT LAST_INSERT_ID();"
					$dataTable = new-object System.Data.DataTable
					$dataTable = $actionInsertAndSelect.Tables[0]
					checkActionEnd -actionID $dataTable.rows[0][0]
				}
				else
				{
					[System.Windows.Forms.MessageBox]::Show("MAC adresa nieje uvedená v správnom tvare")
				}
			}
			else
			{
				[System.Windows.Forms.MessageBox]::Show("IP adresa nieje uvedená v správnom tvare")
			}
		}
		
		
