	function validateMACaddress()
	{
		if ($textboxMAC.Text -match '^[0-9A-F]{2}:[0-9A-F]{2}:[0-9A-F]{2}:[0-9A-F]{2}:[0-9A-F]{2}:[0-9A-F]{2}$')
		{
			$textboxMAC.ForeColor = 'Green'
			$errorprovider2.SetError($textboxMAC, "")
			return $true
			
		}
		else
		{
			$textboxMAC.ForeColor = 'Red'
			$errorprovider2.SetError($textboxMAC, "Zadajte MAC adresu v tvare XX:XX:XX:XX:XX:XX")
			return $false
		}
	}
	
	function validateIP()
	{
		if (checkIPv4($textboxIP.Text))
		{
			$textboxIP.ForeColor = 'Green'
			$errorprovider1.SetError($textboxIP, "")
			return $true
		}
		else
		{
			$textboxIP.ForeColor = 'Red'
			$errorprovider1.SetError($textboxIP, "Zadajte IP adresu v tvare XX.XX.XX.XX")
			return $false
		}
	}
	
	function validateFormDHCP()
	{
	
		if ((validateIP) -and (validateMACaddress))
		{
			$buttonSpracovať.Enabled = $true
		}
		else
		{
			$buttonSpracovať.Enabled = $false
		}
	}
	
	
	function checkIPv4($ip)
	{
		
		${250-255} = '25[0-5]' # Matches 3 digit numbers between 250 and 255
		${200-249} = '2[0-4]\d' # Matches 3 digit numbers between 200 and 249
		${0-199} = '[01]?\d\d?' # Matches 1, 2 or 3 digit numbers between 0 and 199
		
		$Octet = "( ${250-255} | ${200-249} | ${0-199} )"
		
		$IPv4 = "(?x)^$Octet(\.$Octet){3}$"
		
		if ($ip -match $IPv4)
		{
			return $true
		}
		else
		{
			return $false
		}
	}
	
	
