	function checkActionEnd()
	{
		Param (
			[int]$actionID	
		)
		$dataTable = "not empty"
		$formFQDN.Cursor = 'WaitCursor'
		$formFQDN.Enabled = $false
		$i = 0
		$progressbar1.Visible = $true
		$progressbar1.MarqueeAnimationSpeed = 100
		$script:LawCancelLoop = $false
		$operationStatus.ForeColor = 'Purple'
		$operationStatus.Text = "Prebieha spracovanie príkazu "
		while (($dataTable -ne $null) -and ($i -lt $checkProfileTimeout))
		{
			
			[System.Windows.Forms.Application]::DoEvents()
			if (($i % 100) -eq 0)
			{
				$action = New-Object System.Data.DataSet
				$action = mysqlQuerySelect -query "SELECT * FROM fronta WHERE command='csirt' AND status<>'DONE' AND id='$actionID' "
				$dataTable = new-object System.Data.DataTable
				$dataTable = $action.Tables[0]
				
			}
			sleep -Milliseconds 10
			
			$i++
		}
		
		if ($i -eq $checkProfileTimeout)
		{
			$operationStatus.ForeColor = 'Red'
			$operationStatus.Text = "Operáciu sa nepodarilo spracovať vo vyhradenom čase..."
		}
		else
		{
			$action = New-Object System.Data.DataSet
			$action = mysqlQuerySelect -query "SELECT * FROM fronta WHERE command='csirt' AND status='DONE' AND id='$actionID' "
			$dataTable = new-object System.Data.DataTable
			$dataTable = $action.Tables[0]
			if ((($dataTable.rows[0][2]).split(';', 3))[2] -match "chybove hlasenie")
			{
				$operationStatus.ForeColor = 'Red'
				$operationStatus.Text = "Spracovanie skončilo chybou"
				#[System.Windows.Forms.MessageBox]::Show((($dataTable.rows[0][2]).split(';', 3))[2], "ERROR")
			}
			else
			{
				$operationStatus.ForeColor = 'Green'
				$operationStatus.Text = "Príkaz bol úspešne odoslaný na cieľovy PC"
				#[System.Windows.Forms.MessageBox]::Show((($dataTable.rows[0][2]).split(';', 3))[2], "OK")
			}
		}
		
		$script:LawCancelLoop = $true
		$formFQDN.Cursor = 'Arrow'
		$formFQDN.Enabled = $true
		$progressbar1.Visible = $false
		$progressbar1.MarqueeAnimationSpeed = 0
	}
	function validateFQDN()
	{
		
		if ($textFQDN.Text.ToString() -ne "")
		{
			$textFQDN.ForeColor = 'Green'
			$errorprovider1.SetError($textFQDN, "")
			$buttonFQDNCheck.Enabled = $true
			
		}
		else
		{
			$textFQDN.ForeColor = 'Red'
			$errorprovider1.SetError($textFQDN, "Zadajte FQDN v správnom tvare")
			$buttonFQDNCheck.Enabled = $false
		}
		
	}
	
	$buttonFQDNCheck_Click={
		#TODO: Place custom script here
		if ([System.Windows.Forms.MessageBox]::Show("Naozaj chcete spustiť operáciu na zadanom PC?", "Potvrdenie", [System.Windows.Forms.MessageBoxButtons]::OKCancel) -eq "OK")
		{
			$fqdn = $textFQDN.Text.ToString()
			if ($fqdn -eq "")
			{
				[System.Windows.Forms.MessageBox]::Show("Skontrolujte správnosť zadaného FQDN")						
			}
			else
			{
				$fqdn +=";"
				
				
				$date = Get-Date -Format u
				$actionInsertAndSelect = New-Object System.Data.DataSet
				$actionInsertAndSelect = MysqlQuerySelect -query "INSERT INTO fronta (id, command, parameter, status, date, author) VALUES('', 'csirt', '$fqdn', 'WAITING', '$date', '$author');SELECT LAST_INSERT_ID();"
				$dataTable = new-object System.Data.DataTable
				$dataTable = $actionInsertAndSelect.Tables[0]
				checkActionEnd -actionID $dataTable.rows[0][0]
			}
		}
	}
	
	$textFQDN_TextChanged={
		#TODO: Place custom script here
		validateFQDN
	}
	
	$textFQDN_Validating=[System.ComponentModel.CancelEventHandler]{
	#Event Argument: $_ = [System.ComponentModel.CancelEventArgs]
		#TODO: Place custom script here
		validateFQDN
	}
	
